import Nav1 from './components/Navbar';
import Home from './components/home';
import Footer from './components/footer';
const Homeportal = () => {
    return ( 
        <BrowserRouter>
        <Nav1/>
          <Routes>
            <Route path='/home' element={<Home/>} />
            
        
          </Routes>
          <Footer/>
  
        </BrowserRouter>
     );
}
 
export default Homeportal;
